import React from 'react';
import '../Main.css';
import { CharacterPart } from './CharacterPart.js';
import { CharacterSelector } from './CharacterSelector.js';
import { CharacterCanvas } from './CharacterCanvas.js';
import { CharacterGenerator } from './CharacterRandomGenerator.js';
import {HairButton} from './HairButton.js';
import {HandsButton} from './HandsButton.js';
import {BgButton} from './BgButton.js';



const Main = ({ Reminder, Generator, Donate }) => {
  return (
    <main id="generator" className= "main-inner">
      <Reminder />
      <Generator CharacterPart={CharacterPart} CharacterSelector = {CharacterSelector} CharacterCanvas ={CharacterCanvas} CharacterGenerator = {CharacterGenerator} HairButton = {HairButton} HandsButton = {HandsButton} BgButton = {BgButton}/>
      <Donate />
    </main>)
};

export {Main};
